import React from "react";
import { StyleSheet, Text, Button, View, Image } from 'react-native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import AwesomeButtonRick from 'react-native-really-awesome-button/src/themes/rick';

import Home from '../Home';
import Feed from "../Feed";
import Bookings from '../Bookings';
import Favorites from '../Favorites';

const Stack = createNativeStackNavigator();

const MyStack = () => {
    return (
    <Stack.Navigator>
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="Feed" component={Feed} />
        <Stack.Screen name="Bookings" component={Bookings} />
        <Stack.Screen name="Favorites" component={Favorites} />
    </Stack.Navigator>
    );
};


const styles = StyleSheet.create({
    mainContainer: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center'
    },
    mainView: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center',
        backgroundColor: "#4545d9",
        marginBottom: 20,
        height: '45%',
    },
    buttonView: {
        borderColor: 'transparent',
        position: 'absolute',
        backgroundColor: 'white',
        borderRadius: 20,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 10,
        },
        shadowOpacity: 0.35,
        shadowRadius: 13.00,
        elevation: 8,
        padding: 20,
        borderWidth: 1,
        width: '80%'
    },
    title: {
        textAlign: 'center',
        marginTop: 20,
        marginBottom: 10,
        fontSize: 40,
        fontWeight: 'bold',
        color: '#4545d9'
    },
    subtitle: {
        textAlign: 'center',
        marginTop: 10,
        marginBottom: 35,
        fontSize: 20,
    },
    button: {
        margin: '5'
    }

});


const StartUp = ({ navigation }) => {    
    return (
        <View style={{height: '100%'}}>
            <View style={styles.mainView }>
                <Image source={require('../../assets/icons/main_icon.png')} style={{width: 150, height: 100, bottom: 40, transform:[{rotate: '40deg'}]}} />
            </View>

        <View style={styles.mainContainer}>
            <View style={styles.buttonView}>
                <Text style={styles.title}>GymBooking</Text>
                <Text style={styles.subtitle}>Supérate día a día</Text>
                <AwesomeButtonRick>Iniciar Sesión</AwesomeButtonRick>
                <AwesomeButtonRick>Registrarse</AwesomeButtonRick>

            </View>
        </View>
        </View>
    );
};

export default StartUp;
